import React from 'react';
import './Services.css';

const Services = () => {
  const services = [
    {
      id: 1,
      title: 'Premium Detailing',
      description: 'Complete interior and exterior detailing with premium products for that showroom finish.',
      icon: 'ðŸš—',
      features: ['Interior Deep Clean', 'Paint Protection', 'Ceramic Coating', 'Engine Bay Detail']
    },
    {
      id: 2,
      title: 'Performance Tuning',
      description: 'Enhance your vehicle\'s performance with our expert tuning and modification services.',
      icon: 'âš¡',
      features: ['ECU Tuning', 'Exhaust Systems', 'Air Intake', 'Suspension Upgrades']
    },
    {
      id: 3,
      title: 'Maintenance & Repair',
      description: 'Comprehensive maintenance and repair services using OEM parts and expert technicians.',
      icon: 'ðŸ”§',
      features: ['Oil Changes', 'Brake Service', 'Engine Diagnostics', 'Electrical Systems']
    },
    {
      id: 4,
      title: 'Custom Modifications',
      description: 'Transform your vehicle with custom modifications and personalized styling.',
      icon: 'ðŸŽ¨',
      features: ['Body Kits', 'Wheel Upgrades', 'Audio Systems', 'Lighting Modifications']
    },
    {
      id: 5,
      title: 'Paint & Body Work',
      description: 'Professional paint and body work to restore your vehicle to pristine condition.',
      icon: 'ðŸŽ¯',
      features: ['Paint Matching', 'Dent Removal', 'Panel Replacement', 'Color Change']
    },
    {
      id: 6,
      title: 'Concierge Service',
      description: 'Premium concierge service including pickup, delivery, and white-glove treatment.',
      icon: 'ðŸ‘‘',
      features: ['Pickup & Delivery', 'Loaner Vehicles', 'Progress Updates', 'VIP Treatment']
    }
  ];

  return (
    <section id="services" className="section services">
      <div className="container">
        <h2 className="section-title">Our Premium Services</h2>
        <p className="section-subtitle">
          Experience the highest level of automotive care with our comprehensive range of luxury services
        </p>
        
        <div className="services-grid">
          {services.map((service) => (
            <div key={service.id} className="service-card">
              <div className="service-icon">
                <span>{service.icon}</span>
              </div>
              <h3 className="service-title">{service.title}</h3>
              <p className="service-description">{service.description}</p>
              <ul className="service-features">
                {service.features.map((feature, index) => (
                  <li key={index}>{feature}</li>
                ))}
              </ul>
              <button className="btn btn-secondary service-btn">
                Learn More
              </button>
            </div>
          ))}
        </div>
        
        <div className="services-cta">
          <h3>Ready to Experience Premium Care?</h3>
          <p>Book your appointment today and give your vehicle the attention it deserves.</p>
          <button className="btn btn-primary">Book Appointment</button>
        </div>
      </div>
    </section>
  );
};

export default Services;
